const CartItem = ({ cart }) => {
  console.log(cart);
  return (
    <>
      <tr>
        <td>{cart.product.img1}</td>
        <td>{cart.product.name}</td>
        <td>{cart.product.price}</td>
        <td>{cart.quantity}</td>
        <td>{cart.total}</td>
        <td>Remove</td>
      </tr>
    </>
  );
};

export default CartItem;
